import React from 'react';
import '../css/BarraNav.css'
import { Link } from 'react-router-dom';

function BarraNav(){
    return(
        <div>
           <nav>
            <ul>
                <Link to='/' class='li'><a>Home</a></Link>
                <Link to='/registro' class='li'>Registro</Link>
                <Link to='/login' class='li'>Login</Link>


               
            </ul>
        </nav>
        </div>
    );
}
export default BarraNav;
